import React from 'react';
import { Card, CardContent, Typography, Box, Button, Chip } from '@mui/material';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';

function RagAnalysisPage({ ragAnalysis, onBack }) {
  // No summary box, just frame-by-frame cards as before
  if (!ragAnalysis) {
    return (
      <Box sx={{ p: 4 }}>
        <Typography variant="h5">No RAG analysis data available.</Typography>
        <Button variant="contained" color="primary" onClick={onBack} sx={{ mt: 2 }}>
          <ArrowBackIcon sx={{ mr: 1 }} /> Back
        </Button>
      </Box>
    );
  }

  const { decision, confidence, reasoning, retrieved_docs, frames_analyzed, frame_details } = ragAnalysis;
  // Calculate frame metrics
  const totalFrames = frame_details ? frame_details.length : (retrieved_docs ? retrieved_docs.length : 0);
  const displayedFrames = retrieved_docs ? retrieved_docs.length : 0;
  const safeFramesCount = frame_details ? frame_details.filter(f => {
    const cat = f.visual_analysis && f.visual_analysis.category ? String(f.visual_analysis.category).replace('_', ' ').toLowerCase() : '';
    return positiveCategories.includes(cat);
  }).length : 0;
  // Score: percent of safe frames
  const score = totalFrames > 0 ? Math.round((safeFramesCount / totalFrames) * 100) : 0;
  const status = decision || 'N/A';

  // List of positive categories to treat as safe
  const positiveCategories = [
    'safe content',
    'educational content',
    'entertainment content',
    'news content',
    'tutorials & how-to',
    'community & family-friendly',
    'artistic & creative expression',
    'positive social impact'
  ];
  // Helper: get icon and color for frame type
  const getFrameIcon = (category) => {
    if (!category) return null;
    const cat = String(category).replace('_', ' ').toLowerCase();
    if (positiveCategories.includes(cat)) {
      return <span style={{ color: '#43a047', fontWeight: 'bold', fontSize: 22 }}>✔️</span>;
    }
    return <span style={{ color: '#e53935', fontWeight: 'bold', fontSize: 22 }}>⚠️</span>;
  };

  return (
    <Box sx={{ p: 5, background: 'linear-gradient(120deg, #e3f2fd 60%, #fffde7 100%)', minHeight: '100vh' }}>
  <Box sx={{ display: 'flex', alignItems: 'center', mb: 3 }}>
        <Button variant="outlined" color="secondary" sx={{ mr: 2, fontWeight: 'bold', borderRadius: 3 }} onClick={onBack}>
          ← Back
        </Button>
        <Typography variant="h4" color="primary" sx={{ fontWeight: 'bold' }}>
          RAG Policy Violation Explanations
        </Typography>
      </Box>
      <Card sx={{ mb: 4, background: 'linear-gradient(90deg,#1976d2 60%,#21cbf3 100%)', color: '#fff', boxShadow: 3, borderRadius: 4 }}>
        <CardContent>
          <Typography variant="h5" sx={{ fontWeight: 'bold', mb: 2 }}>
            RAG Analysis Result
          </Typography>
          <Box sx={{ display: 'flex', gap: 2, flexWrap: 'wrap', mb: 2 }}>
            <Chip label={`Decision: ${status}`} color="primary" sx={{ fontSize: '1.1rem' }} />
            <Chip label={`Confidence: ${confidence !== undefined ? confidence : 'N/A'}`} color="success" sx={{ fontSize: '1.1rem' }} />
            <Chip label={`Score: ${score}%`} color="info" sx={{ fontSize: '1.1rem' }} />
            <Chip label={`Safe Frames: ${safeFramesCount}/${totalFrames}`} color="success" sx={{ fontSize: '1.1rem' }} />
          </Box>
          <Typography variant="body1"><b>Reasoning:</b> {reasoning || 'N/A'}</Typography>
          <Box sx={{ mt: 2 }}>
            <Typography variant="body2" color="info.main">
              <b>Total Frames Analyzed by Model:</b> {totalFrames}
            </Typography>
            <Typography variant="body2" color="info.main">
              <b>Frames Displayed:</b> {displayedFrames}
            </Typography>
            {totalFrames !== displayedFrames && (
              <Typography variant="body2" color="warning.main" sx={{ fontWeight: 'bold', background: '#fff3e0', borderRadius: '6px', p: '6px 12px', display: 'inline-block' }}>
                <span role="img" aria-label="info">ℹ️</span> Only the first {displayedFrames} frames are shown based on your settings.
              </Typography>
            )}
          </Box>
        </CardContent>
      </Card>
  <Box sx={{ mb: 2 }}>
        <Typography variant="h5" color="primary" sx={{ fontWeight: 'bold', mb: 2 }}>
          Frame & Audio Details
        </Typography>
        {retrieved_docs && retrieved_docs.length > 0 ? (
          <Box sx={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(420px, 1fr))', gap: 3 }}>
            {retrieved_docs.map((doc, idx) => (
              <Card key={idx} sx={{
                background: positiveCategories.includes(String(doc.category).replace('_', ' ').toLowerCase()) ? '#e8f5e9' : '#fff3e0',
                borderRadius: 3,
                boxShadow: 2,
                border: positiveCategories.includes(String(doc.category).replace('_', ' ').toLowerCase()) ? '2px solid #43a047' : '2px solid #e53935'
              }}>
                <CardContent>
                  <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
                    {getFrameIcon(doc.category)}
                    <Typography variant="subtitle1" sx={{ fontWeight: 'bold', ml: 1, color: positiveCategories.includes(String(doc.category).replace('_', ' ').toLowerCase()) ? 'success.main' : 'error.main' }}>
                      {doc.category ? (String(doc.category).replace('_', ' ').replace('content', '').trim()) : 'Frame'}
                    </Typography>
                  </Box>
                  {/* Context: frame number, timestamp, etc. */}
                  {doc.frame !== undefined && (
                    <Typography variant="body2" sx={{ mb: 0.5 }}>
                      <b>Frame #:</b> {doc.frame}
                    </Typography>
                  )}
                  {doc.timestamp !== undefined && (
                    <Typography variant="body2" sx={{ mb: 0.5 }}>
                      <b>Timestamp:</b> {doc.timestamp}s
                    </Typography>
                  )}
                  <Box sx={{ display: 'flex', gap: 1, flexWrap: 'wrap', mb: 1 }}>
                    {doc.confidence !== undefined && (
                      <Chip label={`Confidence: ${doc.confidence}`} color="success" />
                    )}
                  </Box>
                  {/* Consistent policy and examples for safe/violation frames */}
                  {doc.policy && <Typography variant="body2" sx={{ mb: 0.5 }}><b>Policy:</b> {doc.policy.description}</Typography>}
                  {doc.examples && doc.examples.length > 0 && <Typography variant="body2" sx={{ mb: 0.5 }}><b>Examples:</b> {doc.examples.join(', ')}</Typography>}
                  {doc.action_required && <Typography variant="body2" sx={{ mb: 0.5 }}><b>Action Required:</b> {doc.action_required}</Typography>}
                  {doc.severity_indicators && doc.severity_indicators.length > 0 && <Typography variant="body2" sx={{ mb: 0.5 }}><b>Severity Indicators:</b> {doc.severity_indicators.join(', ')}</Typography>}
                  {doc.context_factors && doc.context_factors.length > 0 && <Typography variant="body2" sx={{ mb: 0.5 }}><b>Context Factors:</b> {doc.context_factors.join(', ')}</Typography>}
                  {/* Transcript Excerpt: show if available, or if frame is borderline (confidence < 0.85) */}
                  {(doc.transcript && doc.transcript.length > 0) || (doc.confidence !== undefined && doc.confidence < 0.85) ? (
                    <Typography variant="body2" sx={{ mb: 0.5, color: '#1976d2' }}><b>Transcript Excerpt:</b> {doc.transcript ? doc.transcript : (doc.policy && doc.policy.description ? doc.policy.description : '')}</Typography>
                  ) : null}
                  {doc.keywords && doc.keywords.length > 0 && <Typography variant="body2" sx={{ mb: 0.5 }}><b>Keywords:</b> {doc.keywords.join(', ')}</Typography>}
                  {/* Concise summary for safe/violation frames */}
                  {positiveCategories.includes(String(doc.category).replace('_', ' ').toLowerCase()) ? (
                    <Typography variant="body2" sx={{ mt: 1, color: '#43a047', fontWeight: 'bold' }}>No violation detected. Content is safe.</Typography>
                  ) : null}
                  {!positiveCategories.includes(String(doc.category).replace('_', ' ').toLowerCase()) && (String(doc.category).toLowerCase().includes('violation') || doc.policy) ? (
                    <Typography variant="body2" sx={{ mt: 1, color: '#e53935', fontWeight: 'bold' }}>Violation detected. Please review policy details.</Typography>
                  ) : null}
                </CardContent>
              </Card>
            ))}
          </Box>
        ) : (
          <Typography>No RAG explanations found.</Typography>
        )}
      </Box>
    </Box>
  );
}

export default RagAnalysisPage;
